import React, { Component } from "react";

import Card from "./Card";
import CountDown from "./CountDown";

import PaymentPic from "../../images/payment1.jpg";
import MemberCardPic from "../../images/memberCard2.jpg";
import MenuPic from "../../images/shabuMenu.jpg";

class MainPage extends Component {
  render() {
    return (
      <div>
        <div className="my-container" style={{ height: "100%" }}>
          <CountDown />
        </div>
        <div className="container">
          <div
            className="row justify-content-center"
            style={{ justifyContent: "center" }}
          >
            <Card image={MenuPic} text="สั่งอาหาร" link="/food" />
            <Card image={MemberCardPic} text="สำหรับสมาชิก" link="member" />
            <Card image={PaymentPic} text="ชำระเงิน" link="payment" />
          </div>
        </div>
      </div>
    );
  }
}
export default MainPage;
